import styled from 'styled-components'

export const ProductStyle = styled.div`

    .container {
        width: 98vw;
        margin: 0 auto;
        padding: 30px 0;
    }

    box-sizing: border-box;
    display: flex;
    justify-content: space-between;

    padding: 20px 18px;
    margin-bottom: 20px;
    background-color: #fff;
    box-shadow: 1px 1px 5px #c8c8c8;
`
